import React from 'react'

class Header extends React.Component{
    render(){
        return(
            <>
            <header className='top'>
                <h1><span className='ofThe'>Catch</span> of the day</h1>
                <h3>
                    <span>Fresh Daily</span>
                </h3>
            </header>
            </>
        )
    }
}

export default Header
